import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import React from 'react';
function VizNavigation() {
  const [state, setState] = useState({
    last_month: new Date().setDate(0),
    my_month: Date.prototype.getMonth(this.last_month),
    my_year: Date.prototype.getFullYear(this.last_month),
    month_year_last_month: this.my_month + "/" + this.my_year,
    static_location_crime_label: "Crime Rate by Zip Code: " + this.my_month + "/" + this.my_year
  });

  return (

    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="/">Home</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/about-the-data">About the Data</Nav.Link>
            <NavDropdown title="Crime Rate Over Time" id="basic-nav-dropdown">
              <NavDropdown.Item href="/crime-rates-over-time">Over Time (since 2001)</NavDropdown.Item>
              <NavDropdown.Item href="/income-and-crime-rates">
                Crime Rate and Unemployment in Chicago
              </NavDropdown.Item>
            </NavDropdown>
            <NavDropdown title="Crime Rate by Area">
              <NavDropdown.Item href={state.static_location_crime_label}></NavDropdown.Item>
              <NavDropdown.Item href={"Crime Rate by Zip Code Since 2001"}></NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default VizNavigation;
